import React, { useEffect } from 'react';
import OrderedProductsBody from '../../components/OrderedProducts/OrderedProductsBody';
import HeaderOfPage from '../../components/Header/HeaderOfPage';
import { useDispatch, useSelector } from 'react-redux';
import '../../components/OrderedProducts/orderedProducts.css';
import { fetchOrderProductsByNickname } from '../../features/formSlice';

const OrderedProducts = () => {
    const store = useSelector(state => state.productsSlice)
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchOrderProductsByNickname('Andy'))
    }, [dispatch])
    return (
        <div className="orderedProductsPage">
            <HeaderOfPage 
                sum={store.sumOfPricesAddedProducts} 
                count={store.amountAddedProducts} 
            />
            <OrderedProductsBody 
                product={store.productByNickname}
                date={store.dateOfOrder}    
            />
        </div>
    )
}

export default OrderedProducts
